INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0x05148CC4A7EE4415917CA478AEF8EAD5, 0, '2024-05-20 21:08:47', '2024-05-20 21:08:47', 'Landscape Supplier', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'A landscape supplier furnishes materials and supplies essential for outdoor projects, ranging from residential gardens to commercial developments. They offer a wide array of items such as plants, trees, soil, mulch, gravel, and decorative rocks. Catering to landscapers, contractors, and homeowners, they provide expertise on plant selection, soil types, and project requirements. Landscape suppliers play a pivotal role in ensuring the success and sustainability of landscaping endeavors by offering quality products and knowledgeable assistance.');
INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0x250F0927F0634707B0153A1A9C549115, 0, '2024-05-20 21:05:34', '2024-05-20 21:05:34', 'Garden Center', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'A garden center is a retail establishment specializing in the sale of plants, gardening supplies, and related products. These centers offer a wide range of items including flowers, trees, shrubs, seeds, gardening tools, soil amendments, and outdoor dÃ©cor. Staff provide expert advice on plant care, landscaping, and garden design, catering to both amateur gardeners and professionals. Garden centers often host workshops, demonstrations, and community events to educate and engage customers in gardening pursuits.');
INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0x54286C5F71814166A07E21C0A05D57E5, 0, '2024-05-20 21:54:05', '2024-05-20 21:54:05', 'Pond Maintenance', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'A pond maintenance business specializes in the care and upkeep of ponds, water features, and aquatic ecosystems. Services typically include cleaning, algae control, water quality testing, filtration system maintenance, and aquatic plant care. Professionals ensure the health and beauty of ponds, promoting balanced ecosystems and optimal water conditions. They may also offer pond design, installation, and repair services, catering to residential, commercial, and institutional clients seeking to enhance their outdoor spaces with tranquil and vibrant water features.');
INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0x6B3AFBF9E575419B8539E983ECF6C8AB, 0, '2024-05-20 21:11:45', '2024-05-20 21:11:45', 'Nursery', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'A nursery is a specialized facility where plants are propagated, grown, and nurtured for sale. It offers a diverse selection of plants, including trees, shrubs, flowers, and vegetables, often organized by type and size. Nurseries provide expert guidance on plant care, cultivation techniques, and landscaping ideas. They serve both amateur gardeners and professionals, offering healthy, well-cared-for plants and essential gardening supplies. Nurseries contribute to the beautification of landscapes and the enjoyment of gardening enthusiasts.');
INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0x6EA158205D6D49D782AB93C23C37F637, 0, '2024-05-20 21:03:31', '2024-05-20 21:03:31', 'Landscaper', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'Designs, installs, and maintains outdoor spaces, combining elements like plants, trees, flowers, and hardscape features to create harmonious environments. They assess site conditions, consider client preferences, and utilize knowledge of soil, climate, and plant species to craft functional and aesthetically pleasing landscapes. With expertise in horticulture and design principles, they transform yards, parks, and commercial properties into inviting retreats or vibrant showcases. Whether enhancing curb appeal or fostering natural habitats, landscapers balance creativity with practicality to bring outdoor visions to life.');
INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0x94B68C0D41244A7683FAB022C308A42C, 0, '2024-05-20 21:07:30', '2024-05-20 21:07:30', 'Hardscape Supplier', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'A hardscape supplier specializes in providing materials for non-living, structural elements in landscaping, such as stone, brick, concrete, and wood products. They offer a diverse range of items including pavers, retaining walls, decorative stones, mulch, and landscape edging. Hardscape suppliers cater to contractors, landscapers, and homeowners, offering expert advice on material selection, design options, and installation techniques. Their products enhance outdoor spaces, providing durability, functionality, and aesthetic appeal to landscaping projects.');
INSERT INTO greenyp.line_of_business (id, version, create_date, last_update_date, line_of_business, created_by_type, create_by_reference, enable_distance_radius, description) VALUES (0xC891D114760340AABE8DE55A23D0D1FF, 0, '2024-05-20 21:04:45', '2024-05-20 21:04:45', 'Lawn Care', 'SYSTEM_DEFAULT', 'SYSTEM_DEFAULT', 'N', 'Lawn care involves maintaining and improving the health and appearance of grassy areas. Services typically include mowing, edging, fertilizing, and weed control. Professionals assess soil conditions, provide proper irrigation, and address issues like pests and diseases to ensure lush, green lawns. Regular maintenance enhances curb appeal, promotes healthy growth, and creates enjoyable outdoor spaces for recreation and relaxation.');
